import React from 'react';
import { Link } from 'react-router-dom';
import{logo} from '../assests/img/LOGO.png'

function Header() {
    return (
        <div>
        <img src={logo} alt='Logo Kasa' />
        <nav>
            <Link to="/Home">Accueil</Link>
            <Link to="/About">A Propos</Link>
        </nav>
    </div>
    )
}

export default Header
